import React from 'react';
import './App.css';
import MovieList from './movies';
import Podcasts from './podcasts';

function NavBar() {
  return (
    <nav className="nav">
      <button className="btn btn-primary" onClick={App}>
        Home
      </button>
      <button className="btn btn-primary" onClick={MovieList}>
        Movies
      </button>
      <button className="btn btn-primary" onClick={Podcasts}>
        Podcasts
      </button>
    </nav>
  );
}

export default NavBar;

function App() {
  return (
    <div className="App">
      <h1>Welcome to Joel Hilton's Movie Collection</h1>
    </div>
  );
}

export default App;
